import React from 'react';

const ExpandArrowIcon = ({ className }) => (
  <svg className={className} width="12" height="12" viewBox="0 0 24 24">
    <path
      fill="none"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
      d="M7 10L12 15 17 10"
    />
  </svg>
);

export default ExpandArrowIcon;
